  array('id' => '1','resource' => 'items','owner_id' => '1','is_public' => '1','title' => 'Asthme','text' => 'Asthme 
\'asthme se manifeste généralement sous différentes formes :
La toux, généralement sèche et survenant par quinte. Elle peut annoncer le début d\'une crise ou en être la principale manifestation ;
Les sifflements dans la poitrine est certainement le symptôme le plus courant de l\'asthme ;
La gêne respiratoire associée au sifflement peut également prendre des formes différentes. Une oppression (ou sensation de thorax bloqué) pourra être prise pour une alerte cardiaque chez les seniors. 
Ces signes peuvent survenir la nuit ou à l\'effort, souvent entrecoupées de longues périodes d\'accalmie. Mais trop souvent encore, ces signes passent inaperçus et le diagnostic n\'intervient que tardivement. "Il m\'arrive de rencontrer des patients qui ont traîné de tels symptômes pendant des mois, voire des années avant d\'être diagnostiqués asthmatiques. Un seul de ces symptômes peut évoquer la maladie. Ce sont des indices au même titre que la présence d\'antécédents familiaux d\'asthme ou d\'allergie" nous déclare le Dr Pierrick Hordé, allergologue. 
Symptômes Asthme : Toux, sifflements, gêne respiratoire... Les symptômes de l\'asthme sont bien connus, mais ils sont peu caractéristiques. Comment les distinguer d\'autres affections respiratoires ? Comment poser le diagnostic ? Les réponses.'),
