  array('id' => '40','resource_id' => '9','property_id' => '4','value_resource_id' => NULL,'type' => 'literal','lang' => '','value' => 'L\'estomac est un organe de l\'appareil digestif. Il est situé dans la partie supérieure et médiane de l\'abdomen (région épigastrique). Il fait suite à l\'œsophage et précède le duodénum. L\'estomac participe à la digestion.
90 % des cancers de l\'estomac sont des adénocarcinomes.
On estime à environ 6 550 le nombre de nouveaux cas de cancers de l\'estomac en France en 2012, dont près de 66 % concernent des hommes.
Le cancer de l\'estomac est associé à plusieurs facteurs de risque, notamment, une gastrite chronique principalement liée à une infection par la bactérie Helicobacter pylori, le tabagisme, une alimentation riche en produits salés et pauvre en légumes et fruits frais, des antécédents de cancer de l\'estomac dans la famille ou encore une prédisposition génétique augmentant le risque de développer un cancer de l\'estomac.','uri' => NULL,'is_public' => '1'),
