  array('id' => '45','resource_id' => '8','property_id' => '2','value_resource_id' => NULL,'type' => 'literal','lang' => '','value' => 'MINSANTE ','uri' => NULL,'is_public' => '1'),
  array('id' => '46','resource_id' => '8','property_id' => '7','value_resource_id' => NULL,'type' => 'literal','lang' => '','value' => '10/01/2020','uri' => NULL,'is_public' => '1'),
  array('id' => '47','resource_id' => '8','property_id' => '4','value_resource_id' => NULL,'type' => 'literal','lang' => '','value' => 'Le cancer du côlon se développe à partir des cellules qui tapissent la paroi interne du côlon. Dans plus de 80 % des cas, il provient d’une tumeur bénigne, appelée polype adénomateux, qui évolue lentement et finit par devenir cancéreuse.
Chaque cancer est unique et se définit notamment en fonction de sa localisation dans le côlon, de sa profondeur dans la paroi, de l’atteinte ou non des ganglions proches du côlon et de la présence ou non de métastases au niveau d’autres organes.','uri' => NULL,'is_public' => '1'),
  array('id' => '48','resource_id' => '8','property_id' => '3','value_resource_id' => NULL,'type' => 'literal','lang' => '','value' => 'Maladies cancérigènes ','uri' => NULL,'is_public' => '1'),
  array('id' => '49','resource_id' => '7','property_id' => '4','value_resource_id' => NULL,'type' => 'literal','lang' => '','value' => 'Un cancer apparaît lorsqu\'une cellule du rein initialement normale se transforme, puis se multiplie de façon incontrôlée en formant un amas de cellules anormales qu\'on appelle une tumeur. Un cancer du rein peut prendre naissance à partir d\'une cellule de différentes parties du rein ; dans la majorité des cas, il se développe à partir d\'une cellule du parenchyme rénal. Ce type de cancer du rein porte le nom de carcinome à cellules rénales.
Le nombre de nouveaux cas de cancer du rein en France était estimé à 11 090 en 2011. Le cancer du rein représente ainsi environ 3 % de l\'ensemble des cancers. Il touche deux fois plus les hommes que les femmes. L\'âge moyen au moment du diagnostic est 65 ans.','uri' => NULL,'is_public' => '1'),
  array('id' => '50','resource_id' => '7','property_id' => '13','value_resource_id' => NULL,'type' => 'uri','lang' => NULL,'value' => 'Référence cancer du rein ','uri' => 'https://www.e-cancer.fr/Patients-et-proches/Les-cancers/Cancer-du-rein/Points-cles','is_public' => '1'),
  array('id' => '51','resource_id' => '7','property_id' => '3','value_resource_id' => NULL,'type' => 'literal','lang' => '','value' => 'Symptômes cancers du rein ','uri' => NULL,'is_public' => '1'),
  array('id' => '52','resource_id' => '6','property_id' => '2','value_resource_id' => NULL,'type' => 'literal','lang' => '','value' => 'MINSANTE ','uri' => NULL,'is_public' => '1'),
  array('id' => '53','resource_id' => '6','property_id' => '7','value_resource_id' => NULL,'type' => 'literal','lang' => '','value' => '10/01/2020','uri' => NULL,'is_public' => '1'),
  array('id' => '54','resource_id' => '6','property_id' => '4','value_resource_id' => NULL,'type' => 'literal','lang' => '','value' => 'Le pancréas est un organe du système digestif. Il est enfoui profondément dans l\'abdomen et se situe derrière l\'estomac, tout contre l\'intestin et à proximité d\'un réseau dense de vaisseaux sanguins. Le pancréas aide à la digestion et joue un rôle majeur dans la régulation du taux de glucose dans le sang.
Un cancer apparaît lorsque des cellules du pancréas se développent et se multiplient de manière anarchique et incontrôlée jusqu\'à former une tumeur maligne. La plupart des tumeurs se situent sur la tête du pancréas, partie de l\'organe proche de l\'intestin.','uri' => NULL,'is_public' => '1'),
