  array('id' => '58','resource_id' => '5','property_id' => '13','value_resource_id' => NULL,'type' => 'uri','lang' => NULL,'value' => 'Maladies de la peau','uri' => 'https://www.e-cancer.fr/Patients-et-proches/Les-cancers/Melanome-de-la-peau/Points-cles','is_public' => '1'),
  array('id' => '59','resource_id' => '5','property_id' => '3','value_resource_id' => NULL,'type' => 'literal','lang' => '','value' => 'Symptômes : Métastases, enflement, douleur, rougeur, ','uri' => NULL,'is_public' => '1'),
  array('id' => '60','resource_id' => '5','property_id' => '91','value_resource_id' => NULL,'type' => 'literal','lang' => '','value' => 'Un mélanome de la peau est une maladie des cellules de la peau appelées mélanocytes. Il se développe à partir d’une cellule initialement normale qui se transforme et se multiplie de façon anarchique pour former une lésion appelée tumeur maligne.
Il existe quatre principaux types de mélanome de la peau : le mélanome superficiel extensif, le mélanome de Dubreuilh, le mélanome nodulaire et le mélanome acrolentigineux. Le traitement de ces différents types de mélanome repose essentiellement sur la chirurgie qui sera adaptée à la topographie (c’est-à-dire à l’endroit où est situé le mélanome) et à la profondeur de la lésion.
Avec près de 11 176 cas estimés en 2012, le mélanome représente entre 2 et 3 % de l’ensemble des cancers. Il touche un peu plus de femmes (53 %) que d’hommes (47 %) et l’âge moyen au diagnostic est de 56 ans. C’est le cancer pour lequel le nombre de nouveaux cas par an (incidence) augmente le plus (10 % par an depuis 50 ans).','uri' => NULL,'is_public' => '1'),
