  array('id' => '81','resource_id' => '12','property_id' => '4','value_resource_id' => NULL,'type' => 'literal','lang' => '','value' => 'La dermatologie est une spécialité de médecine qui s\'occupe de la peau, des muqueuses et des phanères. Elle est associée à la vénérologie, c’est-à-dire l\'étude des maladies vénériennes ou infections sexuellement transmissibles. Le médecin spécialisé pratiquant la dermatologie s\'appelle le dermatologue','uri' => NULL,'is_public' => '1'),
