  array('id' => '87','resource_id' => '11','property_id' => '4','value_resource_id' => NULL,'type' => 'literal','lang' => '','value' => 'L\'oncologie ou carcinologie ou cancérologie est la spécialité médicale d\'étude, de diagnostic et de traitement des cancers. Un médecin qui pratique cette discipline est appelé oncologue ou cancérologue. Le terme vient du grec onkos, signifiant vrac, masse ou tumeur, et le suffixe -logie, signifiant « étude de 
La cancérologie (appelée aussi carcinologie ou oncologie) est la spécialité d\'étude, de diagnostic et de traitement des cancers. Un médecin qui pratique cette discipline est appelé oncologue ou cancérologue. La cancérologie peut être pratiquée dans des services individualisés ou dans des services plus généraux : pneumologie, gastro-entérologie, ORL…','uri' => NULL,'is_public' => '1'),
