  array('id' => '100','resource_id' => '13','property_id' => '4','value_resource_id' => NULL,'type' => 'literal','lang' => '','value' => 'le virus grippal est le seul agent infectieux capable de rendre malade le tiers de la population mondiale en moins de six mois et de causer des millions de décès en une période aussi courte. L’OMS, pour répondre à cette menace, a constitué l’un de ses réseaux les plus efficaces, et le plus ancien, FluNet, connectant entre eux, en temps réel, plus de 112 centres nationaux de la grippe répartis sur les 5 continents (il y en a deux en France, à l’Institut Pasteur de Paris pour le Nord de la France et à l’Université de Lyon, pour le Sud) et quatre centres collaborateurs mondiaux de lutte contre la grippe [1]. Après avoir connu trois pandémies grippales au vingtième siècle, il n’y a aucune raison de ne pas craindre une nouvelle émergence d’une souche de virus grippal à potentiel pandémique au cours du xxi e siècle.','uri' => NULL,'is_public' => '1'),
